import React, { useState, useEffect, useRef } from "react";
import { Box, Button as GrommetButton, Grommet } from "grommet";
import App from "../App";

const Start = ({ onQuizStart }) => {
  const AppBar = () => {
    <Box
      tag="header"
      direction="row"
      align="center"
      justify="between"
      background="light-2"
      pad={{ vertical: "small", horizontal: "medium" }}
      elevation="medium"
    />;
  };

  return (
    <AppBar>
      <h1>클린뷰티 테스트</h1>
      <GrommetButton color="primary" label="start" onClick={onQuizStart} />
    </AppBar>
  );
};

export default Start;
